import React from "react";
import { Link } from "react-router-dom";

const EventsPage = () => {
  const DUMMY_EVENTS = [
    { id: "ev1", name: "event 1" },
    { id: "ev2", name: "event 2" },
    { id: "ev3", name: "event 3" },
  ];

  return (
    <>
      <h1 className="center">EventsPage</h1>

      <div>
        {DUMMY_EVENTS.map((event) => (
          <li key={event.id} className="center flex">
            <Link to={event.id}>{event.name}</Link>
          </li>
        ))}
      </div>
    </>
  );
};

export default EventsPage;
